emxFramework.Attribute.SF1411_10_Require_Government_Property?=10. Bu \u00e7al\u0131\u015fman\u0131n y\u00fcr\u00fct\u00fclmesinde herhangi bir Devlet m\u00fclk\u00fcn\u00fcn kullan\u0131lmas\u0131 gerekecek mi? Gerekecekse l\u00fctfen ne oldu\u011fu belirtin.
emxFramework.Attribute.SF1411_11a_Require_Government_Financing?=11a. Bu teklif edilen s\u00f6zle\u015fmeyi ifa etmek i\u00e7in Devlet s\u00f6zle\u015fme finansman\u0131na ihtiyac\u0131n\u0131z var m\u0131? Varsa 11b'yi doldurun.
emxFramework.Attribute.SF1411_11b_Type_of_Financing=11b. Finansman Tipi
emxFramework.Attribute.SF1411_12_Awarded_Contracts_for_Similar_Items?=12. Son 3 y\u0131l i\u00e7inde ayn\u0131 veya benzer \u00fcr\u00fcnler i\u00e7in taraf\u0131n\u0131za herhangi bir s\u00f6zle\u015fme veya alt s\u00f6zle\u015fme verildi mi? Verildiyse l\u00fctfen hangi s\u00f6zle\u015fme oldu\u011funu belirtin.
emxFramework.Attribute.SF1411_13_Proposal_Consistent_with_Established_Procedures?=13. Bu teklif, mevcut tahmin ve muhasebe uygulamalar\u0131n\u0131z ve prosed\u00fcrlerinizin yan\u0131 s\u0131ra FAR K\u0131s\u0131m 31 maliyet ilkelerine uygun mu? De\u011filse l\u00fctfen a\u00e7\u0131klay\u0131n.
emxFramework.Attribute.SF1411_14a_Subject_to_CASB_Regulations?=14a. Bu s\u00f6zle\u015fme eylemi CASB d\u00fczenlemelerine tabi olacak m\u0131? Olacaksa l\u00fctfen teklif b\u00f6l\u00fcm\u00fcnde a\u00e7\u0131klay\u0131n.
emxFramework.Attribute.SF1411_14b_Submitted_a_CASB_Disclosure_Statement?=14b. CASB Ayd\u0131nlatma Beyan\u0131 (CASB DS-1 veya 2) g\u00f6nderdiniz mi? G\u00f6nderdiyseniz l\u00fctfen teklif b\u00f6l\u00fcm\u00fcnde a\u00e7\u0131klay\u0131n.
emxFramework.Attribute.SF1411_14c_Notified_of_Noncompliance?=Ayd\u0131nlatma beyan\u0131n\u0131za veya maliyet hesaplama standartlar\u0131n\u0131za uygun hareket etmedi\u011finize ya da etmiyor olabilece\u011finize dair bir bildirim ald\u0131n\u0131z m\u0131? Ald\u0131ysan\u0131z l\u00fctfen teklif b\u00f6l\u00fcm\u00fcnde a\u00e7\u0131klay\u0131n.
emxFramework.Attribute.SF1411_14d_Any_Aspect_Inconsistent_with_Disclosed_Practices?=Bu teklifin herhangi bir boyutu, a\u00e7\u0131klad\u0131\u011f\u0131n\u0131z uygulamalarla veya ge\u00e7erli maliyet hesaplama standartlar\u0131yla tutars\u0131z m\u0131? Tutars\u0131zsa l\u00fctfen teklif b\u00f6l\u00fcm\u00fcnde a\u00e7\u0131klay\u0131n.
emxFramework.Attribute.SF1411_Explanations=Se\u00e7ilen cevaplar i\u00e7in gerekli a\u00e7\u0131klamalar

