OOTBParameterization.VRP.VRPParameters.ContainsScripts.Argument= Bir Test Senaryosunu \u2018Donduruldu\u2019 ve 'Yay\u0131nland\u0131' durumuna y\u00fckseltmek i\u00e7in bir Test komut dosyas\u0131 gereksin.
OOTBParameterization.VRP.VRPParameters.ContainsScripts.Argument.tooltip= Test senaryosuyla en az bir test komut dosyas\u0131n\u0131n ili\u015fkilendirilmesini zorunlu k\u0131l\u0131n. Bu, test senaryosunu \u00c7al\u0131\u015fmada durumundan Donduruldu durumuna ve Donduruldu durumundan Yay\u0131nland\u0131 durumuna y\u00fckseltmek i\u00e7in gereklidir. 
OOTBParameterization.VRP.VRPParameters.ContainsRequirements.Argument= Bir test senaryosunu Donduruldu veya Yay\u0131nland\u0131 durumuna y\u00fckseltmek i\u00e7in en az bir ba\u011fl\u0131 gereklilik gerektir. Her ba\u011fl\u0131 gereklilik, test senaryosunun hedef olgunlu\u011funa g\u00f6re ayn\u0131 veya daha y\u00fcksek bir olgunluk durumunda olmal\u0131d\u0131r.
OOTBParameterization.VRP.VRPParameters.ContainsRequirements.Argument.tooltip= Test senaryosuyla en az bir gereklili\u011fin ili\u015fkilendirilmesini zorunlu k\u0131l\u0131n. Bu, test senaryosunu \u00c7al\u0131\u015fmada durumundan Donduruldu durumuna ve Donduruldu durumundan Yay\u0131nland\u0131 durumuna y\u00fckseltmek i\u00e7in gereklidir.
OOTBParameterization.VRP.VRPParameters.ContainsRequirementSpecs.Argument= Bir Test Senaryosunu \u2018Donduruldu\u2019 ve 'Yay\u0131nland\u0131' durumuna y\u00fckseltmek i\u00e7in bir Gereklilik Klas\u00f6r\u00fc, Gereklilik Spesifikasyonu veya Gereklilik B\u00f6l\u00fcm\u00fc gereksin.
OOTBParameterization.VRP.VRPParameters.ContainsRequirementSpecs.Argument.tooltip= Test teknik \u00f6zellikleri, Donduruldu veya Yay\u0131nland\u0131 durumlar\u0131na y\u00fckseltmek i\u00e7in en az bir ba\u011fl\u0131 gereklilik nesnesi (teknik \u00f6zellik klas\u00f6r\u00fc, \u015fart teknik \u00f6zelli\u011fi veya b\u00f6l\u00fcm) gerektirir. Test teknik \u00f6zelliklerini Donduruldu durumuna y\u00fckseltmek i\u00e7in t\u00fcm ba\u011fl\u0131 gereklilik nesnelerinin Donduruldu veya Yay\u0131nland\u0131 durumunda olmas\u0131 gerekir. Benzer \u015fekilde, test teknik \u00f6zelliklerini Yay\u0131nland\u0131 durumuna y\u00fckseltmek i\u00e7in t\u00fcm ba\u011flant\u0131l\u0131 gereklilik nesnelerinin Yay\u0131nland\u0131 durumunda olmas\u0131 gerekir.
